import React from "react";

const ArraySchedule = () => {
    const Schedule = new Array(250);
    const Course = [['TE1',4],['TE1',4],['TE1',4],['TE1',3],['TE1',4],['TE1',2],['TE1',4],['TE1',4],['TE1',4],['TE1',3]];
    const random =() => {
        const random1 = Math.floor(Math.random()*Schedule.length);
        if(Schedule[random1] === undefined){
            Schedule[random1] = Course;
            return Schedule.length = Schedule.length;
        }else{
            random1 = Math.floor(Math.random() * Schedule.length);
        }
    }
    var i = 0;
    while (i < Schedule.length){
        random()
